Commands are at the driver for much of Canopy's flexibility, and are the core mechanism for interacting with nodes. To support commands, nodes implement the deceptively simple CommandNode trait. There are only two methods that need to be implemented to satisfy it: fn commands() -> Vec<CommandSpec> where Self: Sized; fn dispatch( &mut self, c: &mut dyn Core, cmd: &CommandInvocation
) -> Result<ReturnValue>; The commands function returns a list of command specifications - that is commands that are supported by this node. Each CommandSpec has a name, a description, and a type command signature. The converse of this is the dispatch function, which takes a CommandInvocation specifcation, and runs the command on the node. Although these functions are simple, implementing them by hand would be tedious, so Canopy has derive helpers to do this for you. We use the #[derive_commands] attribute on the node impl block, then annotate each individual command with the #[command] attribute. For example: #[derive(StatefulNode)]
struct MyNode { state: NodeState, value: u64,
} #[derive_commands]
impl MyNode { /// Increment our value. #[command] fn inc(&mut self) -> Result<()> { self.value.saturating_add(1); Ok(()) } /// Decrement our value. #[command] fn dec(&mut self) -> Result<()> { self.value.saturating_sub(1); Ok(()) }
}
